import React from 'react';

const Homepage = () => {
    return (
        <div className='text-center p-4 my-5'>
            <h1>Your dream job is
                just a click away</h1>
            <h5 className='col-5 mx-auto'>The simplest way to career opportunities starts here</h5>

        </div>
    );
}

export default Homepage;
